insert into movie (name, image, start_day, end_day, director , film_time, trailer, movie_type_id, content, film_studio, actor, version, employee_id) values ('Dumbledore', 'https://bazaarvietnam.vn/wp-content/uploads/2022/03/Harpers-Bazaar-top-phim-chieu-rap-thang-4-2022_02-scaled.jpg', '2022-10-01', '2022-10-07', 'Gard McGibbon', 158, 'https://www.youtube.com/embed/Y9dr2zw-TXQ', 10, 'Nhiều năm sau các sự kiện của Tội ác của Grindelwald, câu truyện diễn ra song song ở hai nơi là Rio de Janeiro, Brazil và Berlin, Đức và quá trình dẫn đến việc Thế chiến II liên hệ với Thế giới Phù thủy.[7][8] Trước thế lực phát triển đầy mạnh mẽ của Grindelwald, Albus Dumbledore đã ra lệnh cho Newt Scamander cùng với những người bạn của anh làm một nhiệm vụ dẫn đến một cuộc đụng độ với đội quân của Grindelwald và điều đó sẽ khiến Dumbledore phải suy nghĩ liệu bản thân mình sẽ đứng bên ngoài một cuộc chiến đang đến gần bao lâu', 'Flashspan', 'Aldrich Izon', 1, 27);
insert into movie (name, image, start_day, end_day, director , film_time, trailer, movie_type_id, content, film_studio, actor, version, employee_id) values ('Ngôi đền kì quái 2', 'https://static2.yan.vn/YanNews/202006/202006290110185729-37a5bbcf-85a8-4584-b921-ed81bbeab741.png', '2022-11-01', '2022-11-07', 'Gaye Barnsley', 131, 'https://www.youtube.com/embed/SvNDQcxsrjM', 10, 'Nội dung của Ngôi Đền Kỳ Quái 2 chính là nối tiếp Pee Nak 1, hai nhà sư trẻ Balloon (Aim Aue) và First (James Bhuripat) sau một thời gian sống tại đền đã nung nấu ý định hoàn tục để có một cuộc sống bình thường. Tuy nhiên, với lời nguyền của đền họ không thể có cuộc sống bình yên, luôn bị “con ma” quấy rối tìm cách sát hại khiến họ khiếp sợ và quay về đền tìm nơi lương tựa, lẩn trốn.', 'Roomm', 'Maurie Hryniewicki', 1, 29);
insert into movie (name, image, start_day, end_day, director , film_time, trailer, movie_type_id, content, film_studio, actor, version, employee_id) values ('Mắt biếc', 'https://vtv1.mediacdn.vn/thumb_w/640/2019/7/9/main-1562640801939438271170.jpg', '2022-11-16', '2022-11-23', 'Daile Gowrie', 140, 'https://www.youtube.com/embed/ITlQ0oU7tDA', 4, 'Phim Mắt biếc có nội dung nói về các mối tình, mối tình đơn phương của Hồng đối với Ngạn, mối tình đơn phương của Ngạn đối với Hà Lan và mối tình của Hà Lan cùng với Dũng. Trong đó thì mối tình của Ngạn đối với Hà Lan là những tình tiết chủ đạo. Hà Lan là người có đặc điểm nổi bật đó chính là đôi mắt hút hồn. Trong các chuyện tình yêu của bộ phim, chúng ta sẽ được trả nghiệm đủ mọi cung bậc cảm xúc từ tình cảm học trò trong sáng, tình yêu đơn phương buồn da diết, đặc biệt là tình cảm của Ngạn đối với con gái của Hà Lan.', 'Brightbean', 'Jaquelyn Clampe', 1, 15);
insert into movie (name, image, start_day, end_day, director , film_time, trailer, movie_type_id, content, film_studio, actor, version, employee_id) values ('Chị mười ba', 'https://kenh14cdn.com/2020/4/20/0fuqbmycabnkawvgqzyblkpsga4p2a3ac188mdkv-15873522964131163180487.png', '2022-11-18', '2022-11-25', 'Alec Breffitt', 144, 'https://www.youtube.com/embed/HmBvoXsU83Q', 5, 'Chị Mười Ba 3 Ngày Sinh Tử thuộc thể loại hành động, khai thác chủ đề mới mẻ với nội dung kể về cuộc chiến ngầm của giới giang hồ. Bộ phim là cuộc hành trình khó khăn và đầy thử thách khi phải vượt qua 3 ngày sinh tử để bảo vệ những người anh em của chị Mười Ba.', 'Quinu', 'Reinaldos Hanlon', 2, 14);
insert into movie (name, image, start_day, end_day, director , film_time, trailer, movie_type_id, content, film_studio, actor, version, employee_id) values ('Rava', 'https://www.elle.vn/wp-content/uploads/2021/03/03/426530/phim-chieu-rap-Raya-va-rong-than-cuoi-cung-scaled.jpg', '2022-10-31', '2022-11-06', 'Dwain Giorgione', 156, 'https://www.youtube.com/embed/1VIZ89FEjYI', 4, 'Raya and the Last Dragon là dự án thứ 51 của xưởng phim hoạt hình Walt Disney, bộ phim tiếp tục khai thác nhân vật trung tâm là một nàng công chúa người Đông Nam Á và sinh sống trong vùng đất giả tưởng có tên Kumandra. Ở đây tồn tại những câu chuyện về Rồng và viên đá phép thuật giúp họ xua đuổi những thế lực tàn ác Drunn ra khỏi lãnh thổ.', 'Realmix', 'Isabelle Darby', 2, 19);
insert into movie (name, image, start_day, end_day, director , film_time, trailer, movie_type_id, content, film_studio, actor, version, employee_id) values ('Mưu kế thượng lưu', 'https://channel.mediacdn.vn/thumb_w/640/2022/2/1/photo-1-1643720284013571472972.jpg', '2022-11-17', '2022-11-24', 'Meyer Noblett', 115, 'https://www.youtube.com/embed/FiKWGU8etpY', 2, 'Kịch bản xoay quanh Diana Nguyễn (Thiên An đóng), thiếu nữ thâm nhập giới thượng lưu vì ý đồ riêng, dần khám phá nhiều góc khuất của những người "sinh ra đã ở vạch đích". Không chỉ đối mặt với kẻ thù ẩn trong bóng tối, cô còn chịu sự mỉa mai, dè bỉu của các "rich kid".', 'Shuffledrive', 'Lois Gotthard.sf', 1, 28);
insert into movie (name, image, start_day, end_day, director , film_time, trailer, movie_type_id, content, film_studio, actor, version, employee_id) values ('Hai phượng', 'https://bloganchoi.com/wp-content/uploads/2020/05/hai-phuong.jpg', '2022-11-15', '2022-11-22', 'Carey Meriton', 133, 'https://www.youtube.com/embed/zLAvZJsbE1M', 3, 'Tác phẩm mào đầu với đại cảnh giới thiệu vùng quê miền Tây có phần bí hiểm. Nhân vật chính - Hai Phượng (Ngô Thanh Vân) - xuất hiện với vẻ dữ dằn của kẻ chuyên đòi nợ thuê. Cô là giang hồ từ TP HCM dạt về quê cùng con gái (bé Cát Vy). Bất chấp người dân dị nghị, Hai Phượng âm thầm nuôi con. Một ngày nọ, bé bị bọn giang hồ bắt cóc.', 'Tazzy', 'Harmonia Brambley', 2, 26);
insert into movie (name, image, start_day, end_day, director , film_time, trailer, movie_type_id, content, film_studio, actor, version, employee_id) values ('Bố già', 'https://vcdn1-giaitri.vnecdn.net/2021/04/22/bo-gia-quoc-te-jpeg-3870-1619080221.jpg?w=0&h=0&q=100&dpr=2&fit=crop&s=VxPE1wGVIkMkAC8CTXVONg', '2022-11-20', '2022-11-27', 'Nevile Vaillant', 177, 'https://www.youtube.com/embed/jluSu8Rw6YE', 12, 'Tại một xóm lao động nghèo tại Thành phố Hồ Chí Minh, có bốn anh em Giàu, Sang, Phú, Quý. Trong đó, Ba Sang là cha đơn thân, một mình nuôi hai con Quắn và Bù Tọt. Quắn là một YouTuber kiếm tiền từ những lượt xem trên YouTube. Cậu có sở thích sưu tập những món hàng hiệu đắt tiền. Sống gần nhà cha con ông Sang là bà Cẩm Lệ, chủ một cửa hiệu may đồ. Bà Lệ tỏ ra rất thân thiết với gia đình ông Sang và thường xuyên giúp đỡ họ.', 'Feednation', 'Livvyy Andreasson', 1, 7);
insert into movie (name, image, start_day, end_day, director , film_time, trailer, movie_type_id, content, film_studio, actor, version, employee_id) values ('Phi vụ bảo tố', 'https://www.elle.vn/wp-content/uploads/2020/07/07/407333/Phim-chieu-rap-Phi-vu-bao-to.jpg', '2022-11-22', '2022-11-29', 'Joanna Pawel', 153, 'https://www.youtube.com/embed/PnH2AhzRhRQ', 1, 'PHI VỤ BÃO TỐ là cuộc chạm trán giữa tâm bão của hai sĩ quan cảnh sát với âm mưu táo tợn của một băng cướp. Giữa những tháng ngày chật vật vượt qua ký ức đau thương, chàng sĩ quan cảnh sát Cadeo được giao nhiệm vụ sơ tán khẩn cấp cư dân tại một khu chung cư giữa lòng Puerto Rico khi khi cơn bão lịch sử bất ngờ đổ bộ. Tại đây, Cadeo và cộng sự vô tình đụng độ băng cướp “máu lạnh” do John cầm đầu – kẻ sẵn sàng tàn sát để chiếm đoạt các tác phẩm nghệ thuật vô giá. Giữa tình thế ngàn cân treo sợi tóc, cơn bão nghiệt ngã còn đe dọa nhấn chìm cả toà nhà trong biển nước. Liệu sự liều lĩnh và lòng can đảm có giúp hai sĩ quan cảnh sát cùng những cư dân còn sót lại trong toà chung cư sống sót?', 'Reallinks', 'Pammy Klein', 1, 23);
insert into movie (name, image, start_day, end_day, director , film_time, trailer, movie_type_id, content, film_studio, actor, version, employee_id) values ('Án mạng liên hoàn lúc nửa đêm', 'https://thethaovanhoa.mediacdn.vn/Upload/O5NP4aFt6GVwE7JTFAOaA/files/2022/05/an-mang-kinh-hoang-luc-nua-dem.jpg', '2022-11-23', '2022-11-30', 'Baxter Pell', 97, 'https://www.youtube.com/embed/zOZx3mXXcso', 6, 'Câu chuyện thứ hai kể về cô gái Tiwa, cô có khả năng giao tiếp với những người đã khuất. Tiwa đã dùng năng lực giao tiếp của mình để giải cứu ông chủ khách sạn bị ma ám giải thoát khỏi những linh hồn đang bị giam cầm quanh đó. Khi thực hiện điều đó, Tiwa vô tình nhớ lại một vụ án mạng kinh hoàng đã xảy ra trong một căn phòng ở khách sạn đó. Dù đã qua nhiều năm, tác động của nó vẫn còn có sức ảnh hưởng. ', 'Yata', 'Bernetta Dalling', 2, 27);
